import React, { useRef, useState } from 'react';
import axios from 'axios';

const SignLanguageRecognition = () => {
    const [videoInput, setVideoInput] = useState(null);
    const [predictions, setPredictions] = useState([]);
    const [isSpeaking, setIsSpeaking] = useState(false);
    const [speakingWord, setSpeakingWord] = useState('');

    const videoRef = useRef(null);
    const speechSynthesisRef = useRef(window.speechSynthesis);
    const utteranceRef = useRef(null);

    const handleVideoChange = (event) => {
        const file = event.target.files[0];
        setVideoInput(file);
        console.log("Video file selected: ", file);
    };

    const handlePredict = async () => {
        try {
            const formData = new FormData();
            if (videoInput instanceof Blob) {
                formData.append('video', videoInput, 'video.webm');
                console.log("Video blob appended to formData");
            } else {
                alert('Please provide a video input');
                return;
            }

            console.log("Sending request to backend...");
            const response = await axios.post('http://localhost:5000/predict', formData, {
                headers: {
                    'Content-Type': 'multipart/form-data',
                },
            });

            console.log("Response received: ", response.data);
            setPredictions(response.data.prediction);
        } catch (error) {
            console.error('Error predicting:', error);
        }
    };

    const speakText = (text) => {
        utteranceRef.current = new SpeechSynthesisUtterance(text);
        speechSynthesisRef.current.speak(utteranceRef.current);
        setIsSpeaking(true);
    };

    const stopSpeaking = () => {
        if (isSpeaking) {
            speechSynthesisRef.current.cancel();
            setIsSpeaking(false);
        }
    };

    return (
        <div className="container mt-5">
            <h2 className="display-4 mb-4">Sign Language Recognition</h2>
            <div className="mb-3">
                <label>Upload Video:</label>
                <input type="file" accept="video/*" onChange={handleVideoChange} />
            </div>
            <div className="mb-3">
                <button className="btn btn-success" onClick={handlePredict}>
                    Predict
                </button>
            </div>
            {predictions.length > 0 && (
                <div className="mt-3">
                    <p>Predicted Words:</p>
                    <ul>
                        {predictions.map((word, index) => (
                            <li key={index}>
                                <button
                                    className={`btn ${isSpeaking && speakingWord === word ? 'btn-danger' : 'btn-success'}`}
                                    onClick={() => {
                                        if (isSpeaking && speakingWord === word) {
                                            stopSpeaking();
                                        } else {
                                            speakText(word);
                                            setSpeakingWord(word);
                                        }
                                    }}
                                >
                                    {isSpeaking && speakingWord === word ? 'Stop Speaking' : 'Speak'}
                                </button>
                                <span>{word}</span>
                            </li>
                        ))}
                    </ul>
                </div>
            )}
        </div>
    );
};

export default SignLanguageRecognition;
